import React from 'react'

 const QuestionCount = ({setCount, startQuiz}) => {
  return (
    <section>
        <header>
            <h2>Fragenmenge:</h2>
        </header>
        <input onChange={setCount} max="50" type="number"/>
        <input onClick={startQuiz}  value="Generieren!" type="submit"/>

    </section>
  )
}
export default QuestionCount
